import { useEffect } from "react"

function useStats() {
    const [stats, setStats] = useState();
    useEffect(() => {
        async function fetchData() {
            console.log('Fetching Data');
            const data = await fetch('https://covid19.mathdro.id/api')
            .then(data => data.json());
        }
        fetchData();
    }, []);
}

function stats() {
    const stats = useStats();
    return (
        <div>
            <p>Stats:</p>
        </div>
    );
}


